import { createTheme } from '@mui/material/styles';

let theme = createTheme({
    palette: {
        primary: {
            main: '#e8bacf',
        },
        secondary: {
            main: '#bae8d2',
        },
        text: {
            primary: '#434343',
            secondary: '#ffffff',
            background: '#FFF3F9',
        },
    },
});

export default theme;
